@Sami Mudget I guess most judges are decent. But it depends on the system they are serving. The justice system in Germany 1933 to 1945 served the regime and that was mostly bad. They even had special courts created by the regime - the so-called "Volksgerichtshof" (peoples justice court). That one was deadly and the judge served like a really wild prosecutor. This was infamous.
I did not get my days in court as well, but the judge helped me nevertheless. My lawyer told me that usually the upper courts decisions are well done, but they are NOT what you would call "common sense". Therefore every information on the web includes "take no advice from here / ask a lawyer".
